import {
    Component,
    OnInit,
} from '@angular/core';
import {
    FormArray,
    FormBuilder,
    FormGroup,
} from '@angular/forms';
import {
    PdfFormConfig,
    PdfFormField,
    PdfFormPage,
} from '@shared/modules/pdf-form-review/models/pdf-form-review.interfaces';
import { PdfFormReviewService } from '@shared/modules/pdf-form-review/services/pdf-form-review.service';

@Component({
    selector: 'app-pdf-form-review-contacts',
    templateUrl: './demo-pdf-form-review.component.html',
    styleUrls: ['./demo-pdf-form-review.component.scss'],
})
export class DemoPdfFormReviewComponent implements OnInit {
    public pdfPages: PdfFormPage[] = [];

    public demoFormGroup: FormGroup;
    public items: FormArray;
    public formJSON: string;
    public canvasConfig: PdfFormConfig;

    public inputs = [];

    private currentFieldName: string;

    constructor(
        private formBuilder: FormBuilder,
        private pdfFormReviewService: PdfFormReviewService,
    ) {
    }

    ngOnInit() {
        this.canvasConfig = {
            allowMultiple: false,
            color: '#000000',
        };
        // just for demo, set duplicates of one page and set indexes from a cycle
        this.pdfPages = pdfFormResponse.Pages;
        let items = [];

        this.pdfPages.forEach((page: PdfFormPage, index) => {
            items = items.concat(this.createItems(index, page.Fields));
        });

        this.demoFormGroup = this.formBuilder.group({
            items: this.formBuilder.array(items),
        });

        this.onSubmit();
    }

    public getControls() {
        return (this.demoFormGroup.get('items') as FormArray).controls;
    }

    public createItems(pageIndex: number, fields: PdfFormField[]): FormGroup[] {
        const groups: FormGroup[] = [];

        for (const field of fields) {
            this.inputs.push({
                pageId: pageIndex,
                fieldId: field.FullName,
            });

            groups.push(
                this.formBuilder.group({
                    headerControl: field.PartialName,
                    mapControl: field.Text,
                }),
            );
        }

        return groups;
    }

    public onControlFocus(fieldName: string) {
        if (this.currentFieldName !== fieldName) {
            this.pdfFormReviewService.setHighlightRectangle(fieldName);
            this.currentFieldName = fieldName;
        }
    }

    public onAssignFieldOutside(fieldName: string) {
        if (this.currentFieldName === fieldName) {
            this.currentFieldName = '';
            this.pdfFormReviewService.clearHighlights();
        }
    }

    public clearAll() {
        this.pdfFormReviewService.clearHighlights();
    }

    public onSubmit(): void {
        if (!this.demoFormGroup.get('items').valid) {
            this.formJSON = 'All mapping fields are required!';
        } else {
            this.formJSON = JSON.stringify(this.demoFormGroup.get('items').value);
        }
    }

}

